    private void commercialActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_commercialActionPerformed
        if(commercial.isSelected()){
            types.setEnabled(true);
        }
        else{
            types.setEnabled(false);
        }
    }//GEN-LAST:event_commercialActionPerformed

    private void private_buttonActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_private_buttonActionPerformed
        if(private_button.isSelected()){
            types.setEnabled(false);
        }
        else{
            types.setEnabled(true);
        }
    }//GEN-LAST:event_private_buttonActionPerformed

    private void addCarActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_addCarActionPerformed
        String[] car_info = {new ID("car").getId(),Model.getText(),Chassis.getText(),plate.getText(),this.cl.getId(),YOfMan.getText()};
        this.cl.addCar(car_info);
        JOptionPane.showMessageDialog(null, "You have successfully added a new car!");
        new client_homepage(this.cl).setVisible(true);
        this.setVisible(false);
    }//GEN-LAST:event_addCarActionPerformed

