    private void ModelCaretUpdate(javax.swing.event.CaretEvent evt) {//GEN-FIRST:event_ModelCaretUpdate
        if(this.Model.getText().length() > 0){
            this.err1.setBackground(Color.green);
        }
        else{
            this.err1.setBackground(Color.green);
        }
    }//GEN-LAST:event_ModelCaretUpdate

